export default class SideNav extends React.Component{
    render(){
        return(
            <div style={{ background: "#E8E8E8", width: '10%', height: '100vh', display: 'flex', flexDirection: 'column'}}>
                <Card height = '100%' clickable={true} >

                </Card>
            </div>
        );
    }
}
